jobs_results.description:
An exciting opportunity for a Front-end Developer(React.JS) to join a leading e-commerce player and be a part of the growing team.

Mandatory Skill-set
• Degree/Diploma Holder in Information Technology, Computer Science or equivalent;
• Has at least 1 year of hands on technical experience in Front end development and JavaScript;
• Hands on experience in ReactJS and experience with Flux or Redux;
• Familiarity with RESTful APIs;
• Familiar with code versioning tools (e.g. GIT);
• Independent and proactive yet a strong team player;
• Excellent spoken and written communication skills.

Desired Skill-set

Experience in isomorphic React.

Responsibilities
• Developing the latest user-facing features using React.js;
• Designing a modern highly responsive web-based user interface;
• Responsible for translating designs and wireframes into high quality code;
• Manage features changes & enhancements in ensuring the websites are responsive & user friendly;
• Provide technical maintenance by... trouble shooting problems and providing effective solutions;
• Develop and maintain reusable components and front-end libraries;
• Participate in projects, feasibility studies and functional analysis on new product or technology.

Should you be interested in this career opportunity, please send in your updated resume to apply@sciente.com at the earliest.

When you apply, you voluntarily consent to the disclosure, collection and use of your personal data for employment/recruitment and related purposes in accordance with the SCIENTE Group Privacy Policy, a copy of which is published at SCIENTEs website (https://www.sciente.com/privacy-policy).

Confidentiality is assured, and only shortlisted candidates will be notified for interviews.

